import Names from "./Names";
import { BrowserRouter as Router, Seitch, Link, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <h1>heyyyyy</h1>
        <h1>hello</h1>
      </div>
      <switch>
        <Route path="/" exact component={names} />
      </switch>
    </Router>
  );
}

export default App;
